        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { background-color: #000; display: flex; justify-content: center; align-items: center; height: 100vh; overflow: hidden; font-family: 'Rajdhani', sans-serif; color: white; position: relative; }

        @keyframes rgbFlow { 0% { border-color: #ff0000; box-shadow: 0 0 15px #ff0000; color: #ff0000; } 33% { border-color: #00ff00; box-shadow: 0 0 15px #00ff00; color: #00ff00; } 66% { border-color: #0000ff; box-shadow: 0 0 15px #0000ff; color: #0000ff; } 100% { border-color: #ff0000; box-shadow: 0 0 15px #ff0000; color: #ff0000; } }

        .profile-rect { padding: 15px 30px; border: 3px solid; font-family: 'Orbitron', sans-serif; font-size: 28px; letter-spacing: 2px; background: rgba(0, 0, 0, 0.6); animation: rgbFlow 3s linear infinite; text-transform: uppercase; }
        .title { font-size: 20px; letter-spacing: 4px; margin-bottom: 20px; font-weight: bold; color: #ddd; }
        .play-trigger { font-size: 40px; color: rgba(255, 255, 255, 0.5); cursor: pointer; margin-bottom: 20px; transition: 0.3s; }
        .play-trigger:hover { color: #fff; transform: scale(1.1); }
        .links { display: flex; flex-direction: column; gap: 10px; margin-bottom: 20px; }
        .btn { background: rgba(255, 255, 255, 0.05); border: 1px solid; padding: 12px; border-radius: 4px; text-decoration: none; font-size: 14px; font-weight: bold; transition: 0.3s; animation: rgbFlow 3s linear infinite; }
        .social-buttons { display: flex; justify-content: center; margin-top: 10px; }
        .social-btn { display: inline-block; padding: 10px 30px; text-decoration: none; font-weight: bold; font-size: 14px; border: 2px solid; border-radius: 4px; animation: rgbFlow 3s linear infinite; background: rgba(0, 0, 0, 0.5); text-align: center; letter-spacing: 2px; }
